import React from 'react'
import ContactItem from './ContactItem'
const ListOfContacts = (props) => {
    const { headerDetails, setHeaderDetails } = props;
    const contacts=[
        {
            name: "Shivank Jaiswal",
            email: "jaiswalshivank4@gmail.com",
            phno: "7838671875"
        },
        {
            name: "Anuruddha Dey",
            email: "anuruddhadey@gmail.com",
            phno: "123456778"
        },
        {
            name: "Shruti Hobo",
            email: "sjshruti92@gmail.com",
            phno: "804494819"
        }
    ]
    return (
        <div className="contacts-body">
            <div>
            {   
                contacts.map((obj) => {
                    return obj.email!==headerDetails.email?<ContactItem key={obj.email} obj={obj} setHeaderDetails={setHeaderDetails}/>:null;
                })
            }
            </div>
            <div className="contact-display">Shivank</div>
        </div>
    );
}

export default ListOfContacts;
